sources.components/Main/LandingPage/Landing.scss:
.landing {
	&__cont {
		max-width: 1200px;
		margin: 0 auto;
	}
	&__modal-box {
		display: flex;
		flex-direction: column;
		align-items: center;
	}
}

.modal {
	display: flex;
	flex-direction: column;
	align-items: center;
	&__button {
		border: 5px double #f1f8fd;
		font-size: 22px;
		background-color: transparent;
		color: #fff;
		padding: 15px 50px;
		margin: 100px 0;
		border-radius: 5px;
		transition: 0.2s;
		text-transform: uppercase;
		letter-spacing: 1px;

		&:hover {
			background-color: #ffffff1f;
		}
	}
	&__content {
		border: 2px solid #f1f8fd28;
		background-color: #c4c1c13f;
		color: #fff;
		border-radius: 5px;
		padding: 25px;
		opacity: 0;
		max-width: 700px;
		font-size: 19px;
		pointer-events: none;
	}
	.modalShowing-true {
		opacity: 1;
		pointer-events: visible;
	}
	&__btn-cont {
		width: 100%;
		display: flex;
		justify-content: space-between;
		margin-top: 30px;
	}
	&__innerButton {
		font-size: 18px;
		font-weight: 600;
		padding: 10px 30px;
		border-radius: 5px;
		margin-top: 20px;
		color: rgba(39, 37, 37, 0.815);
		background-color: #f88f5ea1;
		border-bottom: 3px solid rgb(88, 104, 116);
		transition: 0.2s;

		&:hover {
			color: rgb(0, 0, 0);
			background-color: #f88f5ed2;
		}
	}
}

.bc-color {
	background-color: rgba(0, 0, 0, 0.178);
	height: 100%;
	width: 100%;
	position: fixed;
	z-index: 1;
	transition: 0.2s;
}

.btn-openModal {
	font-size: 22px;
	background-color: transparent;
	padding: 15px 0;
	width: 220px;

	margin: 50px 0;
	border-radius: 5px;
	transition: 0.2s;
	text-transform: uppercase;
	letter-spacing: 2px;
	display: inline-block;
	cursor: pointer;
	font-weight: 600;
	letter-spacing: 2px;

	&:hover {
		background-color: #ffffff1f;
	}
}

.modal-wrapper {
	border: 2px solid #f1f8fd28;
	background-color: #c4c1c13f;
	color: white;
	padding: 25px;
	width: 70%;
	margin: 0 auto;
	position: relative;
	z-index: 5;
	transition: 0.3s;
}
.modal-header {
	font-size: 18px;
	border-bottom: 2px solid #f1f8fd28;
	display: flex;
	align-items: center;
	justify-content: space-between;
	padding-bottom: 15px;
	margin-bottom: 20px;
	P {
		span {
			text-decoration: underline;
			letter-spacing: 1px;
			font-size: 23px;
		}
	}
	.close-modal-btn {
		text-transform: uppercase;
		font-family: sans-serif;
		background-color: #272c33ab;
		width: 30px;
		height: 30px;
		font-size: 16px;
		border-radius: 50%;
		display: flex;
		align-items: center;
		justify-content: center;
		transition: 0.2s;
		cursor: pointer;

		&:hover {
			background-color: #272c33d2;
		}
	}
}

.modal-text {
	width: 90%;
	margin: auto;
}
.modal-footer {
	border-top: 2px solid #f1f8fd28;
	margin-top: 20px;
	display: flex;
	align-items: center;
	justify-content: space-between;
}
.red {
	background-color: tomato;
}
.green {
	background-color: rgba(87, 190, 56, 0.781);
}
.btn-cancel {
	font-size: 18px;
	font-weight: 600;
	padding: 10px 30px;
	border-radius: 5px;
	margin-top: 20px;
	color: rgba(255, 255, 255, 0.863);
	border-bottom: 3px solid rgb(88, 104, 116);
	transition: 0.2s;
	text-transform: uppercase;
	letter-spacing: 1px;
	cursor: pointer;

	&:hover {
		opacity: 0.8;
	}
}
